import React from 'react'

import Background from '../components/Background'

const styles = {
    container: {
        width: '100vw',
        position: 'relative',
        backgroundColor: '#eee'
    }
}

const Index = () => (
    <section style = { styles.container }>
        <Background />
    </section>
)

export default Index
